int memo[1<<10][10][1000];

int dfs(int used, int n, int s){
	if(n == 0) return s == 0;
	if(memo[used][n][s] != -1) return memo[used][n][s];

	int cnt = 0;
	rep(i, 10){
		int num = 1<<i;
		if(used&num) continue;
		used |= num;
		cnt += dfs(used, n-1, s-i*n);
		used &= ~num;
	}
	return memo[used][n][s] = cnt;
}

