typedef pair<int,int> pii;
typedef pair<pii,int> piii;

map<piii,int> memo;

int saiki(int depth, int used, int lest){
	piii key = piii(pii(depth,used),lest);
	map<piii,int>::iterator it = memo.find(key);
	if(it!=memo.end())return it->second;

	if(lest<0)return it->second=0;
	if(depth==n){
		if(lest==0)return it->second=1;
		return it->second=0;
	}

	int ret = 0;
	rep(i,N){
		if((used&(1<<i))==0){
			ret += saiki(depth+1, used|(1<<i), lest-(depth+1)*i);
		}
	}
	return it->second=ret;
}

class Q{
	public:
	int i,n,s;
	Q(int i,int n,int s):i(i),n(n),s(s){}
	bool operator<(const Q& a)const{
		if(i!=a.i)return i<a.i;
		if(n!=a.n)return n<a.n;
		return s<a.s;
	}
};
int main(){
	vector<Q> in;
	int s,cnt=0;
	while(cin>>n>>s){
