		in.push_back(Q(cnt,n,s));
		cnt++;
	}
	sort(in.begin(),in.end());

	vector<int> ans(in.size());
	rep(i,in.size()){
		if(i!=0 && in[i].n!=in[i-1].n){
			memo.clear();
		}

		n = in[i].n;
		ans[in[i].i]=saiki(0,0,in[i].s);
	}

	rep(i,ans.size()){
		printf("%d\n",ans[i]);
	}
}

