/* genperm1 from http://www5.airnet.ne.jp/tomy/cpro/pe1.htm (C) Tomy */
void genperm1(int p[], int n)
{
	int c[MAX], *pc, *q;
	int k, t;

	for(k = 1, q = p, pc = c; k <= n; )	*q++ = *pc++ = k++;
	k = 1;
	pc = c;
	do
	{
		int tmp = 0;
		t = *(p + k);
		*(p + k) = *(q = p + ((k & 1)? *pc: 0));
		*q = t;
		for(int i = 0; i < n; i++){
			tmp += qq[i + 1][gnums[p[i] - 1]];
		}
		if( tmp == s ) ans++;
		k = 1;
		pc = c;
		while(*pc == 0)	*pc++ = k++;
		(*pc)--;
	} while(k < n);
}

