void prm(int k[10], int r, int n, int s, int& cnt, int& sum)
{
	if(r>=n){
		if(sum==s)
			cnt++;
		return;
	}

	for(int i=r; i<10; i++){
		int tmp = k[r];
		k[r] = k[i];
		k[i] = tmp;
		sum += (r+1)*k[r];
		if(sum<=s)
			prm(k, r+1, n, s, cnt, sum);
		sum -= (r+1)*k[r];
		k[i] = k[r];
		k[r] = tmp;
	}
}

int main()
{
	while(!cin.eof()){
		string str;
		getline(cin, str);
		if(str.empty())
			continue;

		istringstream ist(str);
		int n, s;
		ist >> n >> s;

		int k[10];
		for(int i=0; i<10; i++)
			k[i] = i;

		int cnt = 0;
		int sum = 0;
		prm(k, 0, n, s, cnt, sum);

		cout << cnt << endl;
	}

	return 0;
}

