int dp[11][751][2048];

int main()
{
	dp[0][0][0] = 1;

	for (int i = 0; i < 10; i++){
		for (int j = 0; j < 801; j++){
			for (int k = 0; k < 2048; k++){
				for (int l = 0; l <= 9; l++){
					if (!(k & (1 << l)) && dp[i][j][k]){
						dp[i + 1][j + l * (i + 1)][k | (1 << l)] += dp[i][j][k];
					}
				}
			}
		}
	}

	int n, s;
	while (scanf("%d %d", &n, &s) != EOF){
		int num = 0;
		for (int i = 0; i < 2048; i++){
			num += dp[n][s][i];
		}
		printf("%d\n", num);
	}

	return 0;
}

