using namespace std;

int n,s;

int search(bool *used,int sum,int dep){
	if(dep==n)	return s==sum;
	if(sum>s)	return 0;

	int cnt=0;
	for(int i=0;i<10;i++){
		if(!used[i]){
			used[i]=true;
			cnt+=search(used,sum+i*(n-dep),dep+1);
			used[i]=false;
		}
	}
	return cnt;
}

