int s, tmp;

int dfs(int n, int now){
  if(n < 0)return 0;
  if(n == 0 && s == now)return 1;
  if(n == 0 && s != now)return 0;
  int i, j, smin = 0, smax = 0;

  j = tmp;
  rep(i, 10){
    if(!use[i])smin += i * j--;
    if(smin + now > s)return 0;
    if(j == tmp - n)break;
  }
  if(smin + now == s)return 1;
  j = tmp;
  per(i, 10){
    if(!use[i])smax += i * j--;
    if(j == tmp - n)break;
  }
  if(smax + now < s)return 0;
  if(smax + now == s)return 1;

  int res = 0;
  rep(i, 10)if(!use[i]){
    if((tmp - n + 1) * i + now > s)return res;
    use[i] = tmp - n + 1;
    res += dfs(n - 1, now + i * (tmp - n + 1));
    use[i] = 0;
  }
  return res;
}

