    }
  } else {
    bool hoge = false;
    int piyo;
    for (int i = 0; i < 10; i++) {
      piyo = 0;
      for (int j = 0; j < th; j++) {
        piyo += num[j];
        if (num[j] == i) {
          hoge = true;
          break;
        }
      }
      if (hoge) {
        hoge = false;
        continue;
      } else if (piyo >= s) {
        continue;
      }
      num[th] = i;
      search(th + 1);
    }
  }
}

