int solve(int n,int f,int s)
{
    if(s>330) return 0;
    if(s<335 && memo[n][f][s] != -1){return memo[n][f][s];}

    if(n==0)
    {
        if(s==0)return 1;
        else return 0;
    }
    if(s<0) return 0;

    int ans = 0;
    for(int i=0;i<10;i++)
    {
        if( (f>>i)&1 )
        {
            ans += solve(n-1,f- (1<<i),s - n*i);
        }
    }
    memo[n][f][s] = ans;
    return ans;

}

