int t[10] = {};


int saiki(int n, int s, bool y[10])
{
	if (n == 1)return s < 10 ? !y[s] : 0;
	if (s>t[n])return 0;
	int count2 = 0;
	for (size_t i = 0; i <= s/n; i++)
	{
		if (!y[i])
		{
			y[i] = 1;
			count2+=saiki(n - 1, s - i*n, y);
			y[i] = 0;
		}
	}
	return count2;

}

int main()
{
	int n, s;
	bool y[10];
	for (size_t i = 2; i < 10; i++)
	{
		t[i] = 1;
		for (size_t j = 0; j < i; j++)
		{
			t[i] *= (9 - j);
		}
	}
	while (cin >> n >> s)
	{
		for (size_t i = 0; i < 10; i++)
		{
			y[i] = 0;
		}
		cout<<saiki(n, s, y)<<endl;
	}
	return 0;
}

#include <iostream>

int used[10];

void solve(const int& sum,
           const int& s, int limit,
           int& cnt) {

    int tmp;

    for (int i = 0; i < 10; ++i) {
        if (used[i] == 0) {
            tmp = i * limit;
            if (limit > 1) {
                int est_sum = 9 * (limit - 1) * (limit - 1);

                if (est_sum + sum + tmp >= s) {
                    used[i] = 1;

                    solve(sum + tmp,
                          s, limit - 1, cnt);
                    used[i] = 0;
                }
            }
            else {
                if (sum + tmp == s) {
                    ++cnt;
                    return;
                }
            }
        }
    }
}

int main() {
    std::ios::sync_with_stdio(false);
    std::cin.tie(0);

    int s, n;

    while (std::cin >> n >> s) {
        int cnt = 0;
        solve(0, s, n, cnt);
        std::cout << cnt << std::endl;
    }

    return 0;
}

