int DFS::dfs (vector<bool> & used, int currs, int currd, int n)
{
	if (currs > sum ){
		return 0;
	} // end if

	if (currd == 0 ){
		if (currs == sum ){
			return 1;
		}else{
			return 0;
		} // end if
	} // end if

	int count = 0;
	int i, j;

	for (i = 9, j = n; i >= 0; j = (10 + j - 1 ) % 10, --i ){
		if (!used[j] ){
			used[j] = true;
			count += dfs (used, currs + t[j][currd], currd - 1, n-1 );
			used[j] = false;
		} // end if
	} // end for

	return count;
}

