#include <iostream>

void solve(const int sum,
          const int& n,
          const int& s, int depth,
          int used, long long int& cnt) {
    if (sum > s) {
        return;
    }
    else if (depth == n) {
        if (sum == s) {
            ++cnt;
        }
        return;
    }

    for (int i = 9; i >= 0; --i) {
        if (used & (1 << i)) {
            continue;
        }
        int est_sum = 0;
        int coef = 9;
        for (int j = 0; j < n - depth - 1; ++j) {
            if (coef == i) {
                --coef;
            }
            while (used & (1 << coef)) {
                --coef;
            }

            est_sum += coef * (n - j);
            --coef;
        }

        if (est_sum + sum + i * depth < s) {
            return;
        }

        solve(sum + i * depth,
            n, s, depth + 1,
            used | (1 << i), cnt);
    }
}

