int solve(int n,int s,bool used[]){
	if(n == 0 && s == 0) return 1;
	if(n <= 0 || s < 0) return 0;

	int sum = 0;
	for(int i=0;i<10;i++){
		if(!used[i]){
			used[i] = true;
			sum += solve(n-1, s-i*n, used);
			used[i] = false;
		}
	}

	return sum;
}

