int rec(int S, int rn, int sum){
	if(sum >= 0 && a[S][sum] != -1){
		return a[S][sum];
	}

	if(sum == 0 && rn == n){
		return 1;
	}

	if(rn == n){//うまく入らなかった
		return 0;
	}

	if(sum < 0){
		return 0;
	}

	int res = 0;
	for(int i=0;i<10;i++){
		if(!(S >> i & 1) && sum-(rn+1)*i >= 0){//使っていない
			res += rec(S | (1 << i), rn+1, sum-(rn+1)*i);
		}
	}
	return a[S][sum] = res;
}

