    std::ios::sync_with_stdio(false);
    std::cin.tie(0);

    int s, n;

    while (std::cin >> n >> s) {
        long long int cnt = 0;
        solve(0, s, n, cnt, 0);
        std::cout << cnt << std::endl;
    }

    return 0;
}

