#include <iostream>
#include <vector>
#include <array>
#include <chrono>
/// 読み込んだデータのつもり
struct Param
{
	int n;
	int s;
};

struct Data{
	short array_;
	int answer_;

	Data()
	: array_()
	, answer_(0)
	{}

	void setUseNumber(int number, bool flag) { 
		array_ = flag ? array_ | (1 << number) : array_ & (~(1 << number));
	}
	bool isUsingNumber(int number)const { return array_ & (1<<number);}
};

void recurcive(Data& data, const Param& param, int depth, int total)
{
	for(int i = 0; i < 10; i++)
	{

		// すでに使われているのでチェックしない
		if(data.isUsingNumber(i)){
			continue;
		}

		total += i*depth;

		// トータルより超えていたらこれ以上減ることはないので終わり
		if(total > param.s) {
			return;
		}

		data.setUseNumber(i, true);
		if(depth > 1) {
			::recurcive(data, param, depth-1, total);
		}
		else
		{
			if(param.s == total) {
				data.answer_++;
			}
		}

		total -= i*depth;
		data.setUseNumber(i, false);
	}
}


int main() {

	Param p;
    while (std::cin >> p.n >> p.s)
    {
        if (p.n < 0 || p.n >= 11) {
            ::printf("0\n");
        }else{
            Data data;
    	    ::recurcive(data, p, p.n, 0);
	        ::printf("%d\n", data.answer_);
        }

    }
	return 0;
}

#include<iostream>

using namespace std;

#define REP(i,n) for(int i=0;i<(n);i++)

const int MAXN = 10;

int ncase;
bool used[MAXN];

void sum(int n,int m,int s,int t)
{
    if(m==n){
        if(s==t) ncase+=1;
        return;
    }
    if(t>s) return;
    if(m==n-1 && (s-t)%(m+1)!=0) return;
    if(used[0] && (s-t)<(m+1)) return;
    REP(i,MAXN){
        if(!used[i]){
            used[i] = true;
            sum(n,m+1,s,t+i*(m+1));
            used[i] = false;
        }
    }
}

int minsum(int n)
{
    int s=0;
    REP(i,n) s+=i*(i+1);
    return s;
}

int maxsum(int n)
{
    int s=0;
    REP(i,n) s+=(MAXN-1-i)*(MAXN-i);
    return s;
}


void solve(int n,int s)
{
    if(s<minsum(n)||maxsum(n)<s){
        cout<<0<<endl;
        return;
    }
