		array_ = flag ? array_ | (1 << number) : array_ & (~(1 << number));
/*		if(flag) {
			array_ |= 1 << number;
		}else {
			array_ &= ~1 << number;
		}
*/		
	}
	bool isUsingNumber(int number)const { return array_ & (1<<number);}
};

void recurcive(Data& data, const Param& param, int depth, int total)
{
	for(int i = 0; i < 10; i++)
	{

		// すでに使われているのでチェックしない
		if(data.isUsingNumber(i)){
			continue;
		}

		total += i*depth;

		// トータルより超えていたらこれ以上減ることはないので終わり
		if(total > param.s) {
			return;
		}

		data.setUseNumber(i, true);
		if(depth > 0) {
			::recurcive(data, param, depth-1, total);
		}
		else
		{
			if(param.s == total) {
				data.answer_++;
			}
		}

		total -= i*depth;
		data.setUseNumber(i, false);
	}
}


