int solve( int t, int state, int sum ) {
    if ( sum > s ) return 0;
    if ( t == n + 1 ) return sum == s;
    for ( int i = 0; i < 10; i++ ) {
        if ( state & (int)pow( 2, i ) ) continue;
        memo[t][state][sum] += solve( t + 1, state + pow( 2, i ), sum + i * t );
    }
    return memo[t][state][sum];
}

