#include <iostream>

int used[10];

void solve(const int& sum,
           const int& s, int limit,
           long long int& cnt) {

    int tmp;
    int coef;
    int est_sum;
    for (int i = 0; i < 10; ++i) {
        if (used[i] == 0) {
            tmp = i * limit;
            if (limit > 1) {
                if (i != 9) {
                    coef = 9;
                }
                else {
                    coef = 8;
                }
                est_sum = coef * (limit - 1) + sum;

                if (limit > 2) {
                    --coef;
                    est_sum += coef * (limit - 2) * (limit - 2);
                }

                if (est_sum + tmp >= s) {
                    used[i] = 1;
                    solve(sum + tmp,
                          s, limit - 1, cnt);
                    used[i] = 0;
                }
            }
            else {
                if (sum + tmp == s) {
                    ++cnt;
                    return;
                }
            }
        }
    }
}

