int next_combination(int p){
    int lsb = p&-p;
    int rem = p+lsb;
    int rit = rem&~p;
    return rem|(((rit/lsb)>>1)-1);
}

int main() {
	for (int n, s; cin >> n >> s; ) {
		int ans = 0;
		for (int mask = (1 << n) - 1; mask < 1 << 10; mask = next_combination(mask)) {
			vi p;
			rep(i, 10) if (mask & 1 << i) p.pb(i);
			do {
				int sum = 0;
				rep(i, n) sum += (i + 1) * p[i];
				if (s == sum) ans++;
			} while (next_permutation(all(p)));
		}
		cout << ans << endl;
	}
	return 0;
}

