int N = 0;
int memo[10][1 << 10][332];
int dfs(int used, int sum, int n) {
    if (sum < 0) return 0;
    if (n == N) return sum == 0;

    if (~memo[n][used][sum]) {
        return memo[n][used][sum];
    }
    int res = 0;

    for (int i = 0; i < 10; i++) {
        if ((used >> i) & 1) {
            res += dfs(used&~(1 << i), sum - ((1 + n) * i), n + 1);
        }
    }
    memo[n][used][sum] = res;
    return res;
}

