int memo[11][1024][332];

int solve( int t, int state, int sum ) {
    if ( sum > s ) return 0;
    if ( t == n + 1 ) return sum == s;
    int answer = 0;
    for ( int i = 0; i < 10; i++ ) {
        if ( state & ( 1 << i ) ) continue;
        answer += solve( t + 1, state | ( 1 << i ), sum + i * t );
    }
    return memo[t][state][sum] = answer;
}

int main() {
    bool first = true;
    while ( cin >> n >> s ) {
        if ( first ) goto solve;
        for ( register int i = 0; i < 10; i++ ) {
