                for ( register int k = 0; k < 332; k++ ) {
                    memo[i][j][k] = 0;
                }
            }
        }
    solve:;
        first = false;
        cout << ( s > 340 ? 0 : solve( 1, 0, 0 ) ) << endl;
    }
    return 0;
}

