void solve(const int& sum,
           const int& s, int limit,
           long long int& cnt,
           const int& used) {

    int tmp;
    int est_sum;

    for (int i = 0; i < 10; ++i) {
        if ((used & (1 << i)) == 0) {
            tmp = i * limit + sum;
            if (limit > 1) {
                est_sum = 9 * (limit - 1) * (limit -1);
                if (est_sum + tmp >= s) {
                    solve(tmp, s, limit - 1, cnt, used | (1 << i));
                }
            }
            else {
                if (tmp == s) {
                    ++cnt;
                    return;  
                }
                else if (tmp > s) {
                    return;
                }
            }
        }
    }
}

