int c (int i, int sum, int t) {
    if (t == 0) return (sum == s ? 1 : 0);
    if (sum >= s) return 0;
    if (dp[i][s-sum] >= 0) return dp[i][s-sum];
    int res = 0;
    for (int j = 0; j < 10; j++) {
        if ((i & 1 << j) > 0 && c(i - (1 << j), sum + j * t, t-1)) res++;
    }
    return dp[i][s-sum] = res;
}

