template<class iter>
bool next_combination(iter f1, iter l1, iter f2, iter l2){
    if((f1==l1)||(f2==l2)){
        return false;
    }
    iter m1 =l1;
    iter m2 =l2; --m2;
    while(--m1!=f1 &&!(*m1<*m2)){
    }
    bool result =(m1==f1)&&!(*f1<*m2);
    if(!result){
        while(f2!=m2 &&!(*m1<*f2)){
            ++f2;
        }
        f1 =m1;
        iter_swap(f1, f2);
        ++f1;
        ++f2;
    }
    if((f1!=l1)&&(f2!=l2)){
        m1 =l1; m2 =f2;
        while((m1!=f1)&&(m2!=l2)){
            iter_swap(--m1, m2);
            ++m2;
        }
        reverse(f1, m1);
        reverse(f1, l1);
        reverse(m2, l2);
        reverse(f2, l2);
    }
    return !result;
}

template<class iter >
bool next_combination(iter first, iter middle, iter last){
