        for(int j=0; j<10; ++j){
            if(bs[j])
                continue;
            bitset<10> bs1 = bs;
            bs1[j] = true;
            int a = j * bs1.count();
            for(int k=0; k+a<331; ++k)
                dp[bs1.to_ulong()][k+a] += dp[bs.to_ulong()][k];
        }
    }

