struct Param
{
	int n;
	int s;
};

struct Data{
//	bool array_[10];
	short array_;
//	std::array<bool, 10> array_;
	int anser_;

	Data()
	: array_()
	, anser_(0)
	{}

	void setUseNumber(int number, bool flag) { 
		array_ = flag ? array_ | (1 << number) : array_ & (~(1 << number));
/*		if(flag) {
			array_ |= 1 << number;
		}else {
			array_ &= ~1 << number;
		}
*/		
	}
	bool isUsingNumber(int number)const { return array_ & (1<<number);}
};

void recurcive(Data& data, const Param& param, int depth, int total)
{
	for(int i = 0; i < 10; i++)
	{

		// すでに使われているのでチェックしない
		if(data.isUsingNumber(i)){
			continue;
		}

		total += i*depth;

		// トータルより超えていたらこれ以上減ることはないので終わり
		if(total > param.s) {
			return;
		}

		data.setUseNumber(i, true);
		if(depth > 0) {
			::recurcive(data, param, depth-1, total);
		}
		else
		{
			printf("total:%d\n", total);
			if(param.s == total) {
				data.anser_++;
			}
		}

		total -= i*depth;
		data.setUseNumber(i, false);
	}
}


int main() {
	Param p = {3, 10};
	Data data;
	auto const begin = std::chrono::high_resolution_clock::now();
    ::recurcive(data, p, 1, p.n-1);
    auto const end = std::chrono::high_resolution_clock::now();
	::printf("anser:%d\ntime:%lld", data.anser_, std::chrono::duration_cast<std::chrono::nanoseconds>(end - begin));
	return 0;
}

