int dfs (int t, int sum, int k) {
    if (t == 0) return sum == s ? 1 : 0;
    if (s < sum) return 0;
    if (dp[t][s-sum] >= 0) return dp[t][s-sum];
    int res = 0;
    for (int i = 0; i < 10; i++) {
        if ((t & (1 << i)) > 0) {
            res += dfs(t-(1<<i), sum + i * k, k-1);
        }
    }

    return dp[t][s-sum] = res;
}

