#define REP(i, j) for(int i = 0; i < j; i++)
#define FOR(i, j, k) for(int i = j; i < k; i++)
const int INF = INT_MAX / 2;
const int NUM = 10;
const int N = 50;
const int S = 331;
const int P = (1 << NUM);

int n, s;
int dp[N][S][P];

void make_dp(){
    REP(i, N) REP(j, S) REP(k, P) dp[i][j][k] = 0;
    int num = 0;
    for(int mask = 1; mask < (1 << NUM); mask = (mask << 1)){
        dp[1][num][mask] = 1;
        ++num;
    }

    FOR(i, 2, N){
        num = 0;
        for(int mask = 1; mask < (1 << NUM); mask = (mask << 1)){
            FOR(j, (num * i), S){
                for(int k = 1; k < (1 << NUM); ++k){
                    if((k & mask) != 0) continue;
                    int p = (k | mask);
                if(j - (num * i) >= 0) dp[i][j][p] += dp[i - 1][j - (num * i)][k];
                }
            }
            ++num;
        }
    }
}

int main(){
    make_dp();
    while(cin >>n >>s){
        if(n > 10){
            cout <<0 <<endl;
            continue;
        }
        int ans = 0;
        REP(i, P) ans += dp[n][s][i];
        cout <<ans <<endl;
    }
    return 0;
}

