int saiki(int n, int s, bool y[10])
{
	if (n == 1)return s < 10 ? !y[s] : 0;
	int count2 = 0;
	for (size_t i = 0; i <= s/n; i++)
	{
		if (!y[i])
		{
			y[i] = 1;
			count2+=saiki(n - 1, s - i*n, y);
			y[i] = 0;
		}
	}
	return count2;

}

