		for(int pk = k - 1; pk >= 0; pk--){
			gnums[pk]++;
			if( gnums[pk] <= n - (k - pk) ){
				for(int j = pk + 1; j < k; j++) gnums[j] = gnums[j - 1] + 1;
				pk++;
				loop = true;
				break;
			}
		}
	}while(loop);
}

