int memo[10][1<<10][400];
int solve( int t, int state, int sum ) {
    if ( t == n ) return sum == s;
    for ( int i = 0; i < 10; i++ ) {
        if ( state & ( 1 << i ) ) continue;
        memo[t][state][sum] += solve( t + 1, state | ( 1 << i ), sum + i * ( t + 1 ) );
    }
    return memo[t][state][sum];
}

