#include <iostream>

void solve(const int& sum,
           const int& s, int limit,
           long long int& cnt,
           int used) {

    int tmp;
    int coef;
    int est_sum;

    for (int i = 0; i < 10; ++i) {
        if ((used & (1 << i)) == 0) {
            tmp = i * limit;
            if (limit > 1) {
                if (i != 9) {
                    coef = 9;
                }
                else {
                    coef = 8;
                }
                est_sum = coef * (limit - 1) * (limit - 1) + sum;

                if (est_sum + tmp >= s) {
                    solve(sum + tmp,
                          s, limit - 1, cnt, used | (1 << i));
                }
            }
            else {
                if (sum + tmp == s) {
                    ++cnt;
                    return;
                }
            }
        }
    }
}

