int init(){
    int i,tmp,tmp2,n,dp,i2,j,k;
    REP(i,K){
        REP(j,N)D[i][j]=0;
        tmp=i,tmp2=0,n=0;
        while(tmp){
            n+=tmp&1;
            tmp2++;
            tmp/=2;
        }
        C[i]=n;
        if(n==1)D[i][std::find(B,B+10,i)-B]=1;
        else{
            tmp=i;
            REP(j,tmp2){
                if(tmp&1){
                    dp=n*j,i2=i-B[j];
                    REP(k,N-dp)D[i][k+dp]+=D[i2][k];
                }
                tmp/=2;
            }
        }
    }
    return 0;
}
