#include <iostream>

void solve(const int sum,
          const int& s, int limit,
          int used, long long int& cnt) {

    if (limit == 0) {
        if (sum == s) {
            ++cnt;
        }

        return;
    }

    for (int i = 9; i >= 0; --i) {
        if (used & (1 << i)) {
            continue;
        }
        int est_sum = 0;
        int coef = 9;
        for (int j = limit - 1; j > 0; --j) {

            while (used & (1 << coef)) {
                --coef;
            }
            if (coef == i) {
                --coef;
            }
            while (used & (1 << coef)) {
                --coef;
            }

            est_sum += coef * j;
            --coef;
        }

        if (est_sum + sum + i * limit < s) {
            return;
        }

        solve(sum + i * limit,
            s, limit - 1,
            used | (1 << i), cnt);
    }
}

