class DP{
public:
	DP( int n, int s ) : maxN( n ), maxS( s ), limitS( 0 ), pmt( 1 << 10 ){
		if ( maxN > 10 ) maxN = 0;
		for ( int i = 0; i < maxN; ++i ){
			limitS += ( 9 - i ) * ( n - i );
		}
		if ( maxS > limitS ) maxS = 0;
		tb = new int[ ( maxN+1 ) * ( pmt ) * ( maxS+1 ) ];
		for ( int i = 0; i < ( maxN+1 ) * ( pmt ) * ( maxS+1 ); ++i ){
			tb[ i ] = -1;
		}
	}
	~DP(){
		delete[] tb;
	}

	int calc( int n, int pmt, int s ){
		int ans = 0;
		if ( s < 0 || s > limitS || n > 10 ) return 0;
		if ( tb[ ( n+1 ) * ( pmt ) * ( s+1 ) ] >= 0 ){
			return tb[ ( n+1 ) * ( pmt ) * ( s+1 ) ];
		}
		if ( n == 1 ){
			if ( s <= 9 && ( !( pmt & ( 1 << s ) ) ) ){
				ans = 1;
			}
		}else{
			for ( int i = 0; i < 10; ++i ){
				if ( !( ( 1 << i ) & pmt ) ){
					ans += calc( n-1, pmt+( 1 << i ), s - i*n );
				}
				tb[ ( n+1 ) * ( pmt ) * ( s+1 ) ];
			}
		}
		return ans;
	}

private:
	int maxN, maxS, limitS, pmt;
	int* tb;
};

