int solve(int n, int s, int used) {
    //cout << n << ' ' << s << ' ' << used << endl;
    if (s < 0) return 0;
    if (n == 0) {
        if (s == 0) return 1;
        return 0;
    }
    if (dp[n][s][used] != -1) return dp[n][s][used];
    int cnt = 0;
    for (int i = 0; i <= 9; i++) {
        if (used & (1<<i)) continue;
        //cout << "used " << i << endl;
        cnt += solve(n-1, s - i*n, used | (1<<i));
    }
    return dp[n][s][used] = cnt;
}

