void rec(char* num, int k, int sum){
	if(k == n+1){
		if(sum == s) {
			ans++;
		}
		return;
	}

	for(int i=0; i<10; i++){
		if(num[i] != 0){
			char temp[10];
			sum += (i*k);

			if(sum > s) continue;
			memcpy(temp, num, 10);
			temp[i] = 0;
			rec(temp, k+1, sum);
			sum -= (i*k);
		}
	}
	return;
}

