int bit[1 << 11][1000];

int dfs(int used, int s, int n, int times, int count){
	if (bit[used][s]){
		return bit[used][s];
	}
	if (count == n){
		return bit[used][s] = (!s) ? 1 : 0;
	}

	int res = 0;
	int num = -1;
	for (int i = 1; i < (1 << 11); i <<= 1){
		num++;
		if (used & i) continue;
		res += dfs(used | i, s - (num * times), n, times + 1, count + 1);
	}

	return bit[used][s] = res;
}

