int memo_dp(std::vector<std::vector<int>> &memo, const int &n, const int &s, const int &used = 0, const int &current_n = 1) {
	if (s < 0 || s > 330) {
		return 0;
	}
	else if (n < current_n) {
		if (s == 0) {
			return 1;
		}
		else {
			return 0;
		}
	}
	else if (memo[used][s] >= 0) {
		return memo[used][s];
	}
	else {
		int res = 0;
		for (auto i = 0; i < 10; ++i) {
			if (((1 << i) & used) == 0) {
				res += memo_dp(memo, n, s - current_n * i, used + (1 << i), current_n + 1);
			}
		}
		memo[used][s] = res;
		return res;
	}
}
int main() {
	std::vector<std::vector<int>> memo(1025, std::vector<int>(331, -1));
	int n, s;
	while (std::cin >> n >> s) {
		std::cout << memo_dp(memo, n, s) << std::endl;
	}
	return 0;
}

class Memo {
	int flag;
	Memo(int n) :flag{ n } {}
public:
	Memo() :flag{ 0 } {}
	class Iterator {
		const int flag;
		int n;
	public:
		Iterator(int aflag, int an) :flag{ aflag }, n{ an } {}
		int operator*() const {
			return n;
		}
		Iterator operator++() {
			while (((1 << ++n) | flag) == flag && n < 10);
			return *this;
		}
		bool operator!=(const Iterator other) const {
			return n != other.n;
		}
	};
	Memo use(int u) {
		return Memo(flag | (1 << u));
	}
	Iterator begin() const {
		return ++Iterator(flag, -1);
	}
	Iterator end() const {
		return Iterator(flag, 10);
	}
};
int f(int n, int s, Memo memo = Memo()) {
	if (n == 0 && s == 0) return 1;
	if (s <= 0) return 0;
	if (n == 0) return 0;
	int sum = 0;
	for (const auto &unuse : memo) {
		sum += f(n - 1, s - unuse * n, memo.use(unuse));
	}
	return sum;
}
int main() {
	int n, s;
	while (std::cin >> n >> s) {
		std::cout << f(n, s) << std::endl;
	}
}

