#include <iostream>
using namespace std;

const int maxN = 10;
const int limitS = 330;
const int gPNT = 1 << 10;

class DP{
public:
	DP(){
		for ( int i = 0; i < ( maxN+1 ) * ( gPNT ) * ( limitS+1 ); ++i ){
			tb[ i ] = -1;
		}
	}

	int calc( int n, int pmt, int s ){
		int ans = 0;
		if ( s < 0 || s > limitS || n > maxN ) return 0;
		if ( tb[ ( n+1 ) * ( pmt ) * ( s+1 ) ] >= 0 ){
			return tb[ ( n+1 ) * ( pmt ) * ( s+1 ) ];
		}
		if ( n == 1 ){
			if ( s <= 9 && ( !( pmt & ( 1 << s ) ) ) ){
				ans = 1;
			}
		}else{
			for ( int i = 0; i < 10; ++i ){
				if ( !( ( 1 << i ) & pmt ) ){
					ans += calc( n-1, pmt+( 1 << i ), s - i*n );
				}
				tb[ ( n+1 ) * ( pmt ) * ( s+1 ) ] = ans;
			}
		}
		return ans;
	}

private:
	int tb[ ( maxN+1 ) * ( gPNT ) * ( limitS+1 ) ];
};

int main(){
	int n, s;
	DP* dp = new DP;

	while ( cin >> n >> s ){
		cout << dp->calc( n, 1 << 10, s ) << endl;
	}

	delete dp;

	return 0;
}

#include <iostream>

class Memo {
	int _flag;
	Memo(int f) :_flag{ f } {}
public:
	Memo() :_flag{ 0 } {}
	Memo use(int unuse) const {
		return Memo(_flag | (1 << unuse));
	}
	class Memo_iterator {
		int _flag, _n;
	public:
		Memo_iterator(int f, int n) :_flag{ f }, _n{ n } {}
		int operator*() const {
			return _n;
		}
		Memo_iterator operator++() {
			while ((_flag & (1 << ++_n)) != 0 && _n < 10);
			return *this;
		}
		bool operator!=(const Memo_iterator &other) const {
			return _n != other._n;
		}
	};
	Memo_iterator begin() const {
		return ++Memo_iterator(_flag, -1);
	}
	Memo_iterator end() const {
		return Memo_iterator(_flag, 10);
	}
};
int f(int n, int s, const Memo memo = Memo()) {
	if (n == 0 && s == 0) return 1;
	if (n <= 0 || s <= 0) return 0;
	int sum = 0;
	for (const auto unused : memo) {
		sum += f(n - 1, s - n * unused, memo.use(unused));
	}
	return sum;
}
int main() {
	int n, s;
	while (std::cin >> n >> s) {
		std::cout << f(n, s) << std::endl;
	}
}

