//S: つかったもの
//v: さっきつかったもの
//rn: 入れた数
//sum: 残る和
int rec(int S, int v, int rn, int sum){
	if(sum == 0 && rn == n){
		return 1;
	}

	if(rn == n){//うまく入らなかった
		return 0;
	}

	int res = 0;
	for(int i=0;i<10;i++){
		if(!(S >> i & 1)){//使っていない
			res += rec(S | (1 << i), i, rn+1, sum-(rn+1)*i);
		}
	}
	return res;
}

int main(){
	int res;
	while(std::cin >> n >> s, !std::cin.eof()){
		res = 0;
		for(int i=0;i<10;i++){
			res += rec(1 << i, i, 1, s-i);
		}
		std::cout << res << std::endl;
	}
}

