using namespace std;
int p;
int search(int n, int s, int t){
  int d = t - s;
  if(n == 1){
    if((p & (1 << d)) == 0) return 1;
    else return 0;
  }
  int r = 0;
  for(int j = min(d/n,9); j >= 0; j--){
    if((p & (1 << j)) == 0) {
      p |= 1 << j;
      r += search(n-1, s + n*j, t);
      p &= ~(1 << j);
    }
  }
  return r;
}
