using namespace std;

int n, s;
int memo[11][1024][400];

int solve( int t, int state, int sum ) {
    if ( sum < 0 ) return 0;
    if ( t == n + 1 ) return sum == 0;
    if ( memo[t][state][sum] != -1 ) return memo[t][state][sum];
    int answer = 0;
    for ( int i = 0; i < 10; ++ i ) {
        if ( state & ( 1 << i ) ) continue;
        answer += solve( t + 1, state | ( 1 << i ), sum - i * t );
    }
    return memo[t][state][sum] = answer;
}

int main() {
    for ( int i = 0; i < 11; ++ i ) {
        for ( int j = 0; j < 1024; ++ j ) {
            for ( int k = 0; k < 400; ++ k ) {
                memo[i][j][k] = -1;
            }
        }
    }
    while ( scanf( "%d%d", &n, &s ) != EOF ) {
        printf( "%d\n", ( s > 400 ? 0 : solve( 1, 0, s ) ) );
    }
    return 0;
}

