void sum(int n,int m,int s,int t)
{
    if(m==n){
        if(s==t) ncase+=1;
        return;
    }
    if(t>s) return;
    REP(i,MAXN-m){
        int j = getelem(i);
        used[j] = true;
        sum(n,m+1,s,t+j*(m+1));
        used[j] = false;
    }
}

