int rec(int S,int sum,int cnt){

  if(dp[S][sum][cnt]!=INF)return dp[S][sum][cnt];

  if(cnt==0){
    if(sum==0)return 1;
    else return 0;
  }

  int res=0,x=0;
  for(int i=0;i<10;i++){
    if((S>>i)&1)x++;
  }

  for(int i=0;i<10;i++){
    if((S>>i)&1)continue;
    res+=rec(S+(1<<i),sum-(x+1)*i,cnt-1);
  }
  return dp[S][sum][cnt]=res;
}

