int used[10];

void solve(const int& sum,
           const int& s, int limit,
           long long int& cnt) {

    if (limit == 0) {
        if (sum == s) {
            ++cnt;
        }

        return;
    }

    for (int i = 9; i >= 0; --i) {
        if (used[i]) {
            continue;
        }
        int est_sum = 0;
        int coef = 9;
        for (int j = limit - 1; j > 0; --j) {

            while (used[coef]) {
                --coef;
            }
            if (coef == i) {
                --coef;
            }
            while (used[coef]) {
                --coef;
            }
            est_sum += coef * j;
            --coef;
        }

        if (est_sum + sum + i * limit < s) {
            break;
        }

        used[i] = 1;
        solve(sum + i * limit,
            s, limit - 1,
             cnt);
        used[i] = 0;
    }
}

