int countSol(int n, int s, bool a[], int depth)
{
	if (s<0) return 0;

	if (n==depth) {
		int k = s / depth;
		return (depth * k == s) && (!a[k]);
	}
	int count = 0;
	for (int i=0; i<10; i++) {
		if (a[i]) continue;
		else {
			a[i] = true;
			count += countSol(n, s - depth*i, a, depth+1);
			a[i] = false;
		}
	}
	return count;
}

