using namespace std;

int saiki(int n, int s, set<int> x)
{
	if (n == 0)return s==0;
	int count2 = 0;
	for (size_t i = 0; i <= s/n; i++)
	{
		if (x.insert(i).second)
		{
			count2+=saiki(n - 1, s - i*n, x);
			x.erase(i);
		}
	}
	return count2;

}

int main()
{
	int n, s;
	set <int> x;
	while (cin >> n >> s)
	{
		cout<<saiki(n, s, x)<<endl;
		x.clear();
	}
	return 0;
}

