    if(s > 9) return 0;
    if((p & (1 << s)) == 0) return 1;
    else return 0;
  }
  if(m[n][p][s] != -1) return m[n][p][s];
  int r = 0;
  for(int j = min(s/n,9); j >= 0; j--){
    if((p & (1 << j)) == 0) {
      p |= 1 << j;
      r += search(n-1, s - n * j);
      p &= ~(1 << j);
    }
  }
  m[n][p][s] = r;
  return r;
}
