void recursive(int depth, int sum, bool flag[10])
{
	++memo[depth][sum];
	for(int i = 0; i < 10; ++i)
	{
		if(flag[i])
		{
			continue;
		}
		flag[i] = true;
		recursive(depth + 1, sum + (depth + 1) * i, flag);
		flag[i] = false;
	}
}

