			return 0;
		}
	}
	else {
		int res = 0;
		for (auto i = 0; i < 10; ++i) {
			if (((1 << i) & used) == 0) {
				res += dp(n, s - current_n * i, used + (1 << i), current_n + 1);
			}
		}
		return res;
	}
}
