           long long int& cnt,
           const int& used) {

    int tmp;
    int est_sum;

    for (int i = 0; i < 10; ++i) {
        if ((used & (1 << i)) == 0) {
            tmp = i * limit;
            if (limit > 1) {
                est_sum = 9 * (limit - 1) * (limit -1) + sum;
                if (est_sum + tmp >= s) {
