void rec(char* num, int k, int sum){
	if(sum < 248) dp[k-1][sum]++;

	for(int i=0; i<10; i++){
		if(num[i] != 0){
			char temp[10];
			memcpy(temp, num, 10);
			temp[i] = 0;

			sum += (i*k);
			if(sum >= 248) continue;

			rec(temp, k+1, sum);
			sum -= (i*k);
		}
	}
	return;
}

