        for (int state = 1, I = 1 << MAX; state < I; ++state) {
            int b = bit(state);
            for (int i = 0; i < MAX; ++i) {
                if (!(state & (1 << i))) {
                    int next = state | (1 << i);
                    for (int j = 0; j < MAX; ++j) {
                        if (state & (1 << j)) {
                            each(d[state][j], p) {
                                LINT num = i * (b+1) + (*p).first;
                                d[next][i][num] += (*p).second;
                            }
                        }
                    }
                }
            }
            if (b == N) {
                for (int i = 0; i < MAX; ++i) {
                    ans += d[state][i][S];
