typedef pair<int,int> pii;

map<pii,int> memo;

int saiki(int depth, int used, int lest){
	pii key = pii(used,lest);
	map<pii,int>::iterator it = memo.find(key);
	if(it!=memo.end())return it->second;

	if(lest<0)return 0;
	if(depth==n){
		if(lest==0)return 1;
		return 0;
	}


	int maxim = 0;
	int cpd = n-1;
	for(int i=N-1;i>=0;i--){
		if(cpd==depth-1)break;
		if((used&(1<<i))==0){
			maxim += i*(cpd+1);
			cpd--;
		}
	}
	if(maxim<lest)return 0;


	int ret = 0;
	rep(i,N){
		if((used&(1<<i))==0){
			ret += saiki(depth+1, used|(1<<i), lest-(depth+1)*i);
		}
	}
	return memo[key]=ret;
}

