		for (int i = 0; i < n; i++){
			for (int j = 0; j < 1000; j++){
				for (int k = 0; k < 1024; k++){
					if (dp[i][j][k]){
						for (int l = 0; l < 9; l++){
							if (~k & (1 << l)){
								dp[i + 1][j + (i + 1) * l][k | (1 << l)] += dp[i][j][k];
