#define SMAX 330 //=0*1+1*2+2*3+...+9*10
int memo[11][SMAX+1][1<<10];
int count(int n, int sum, int unused)
{
	int i, ans, use;
	if (memo[n][sum][unused] >= 0)
		return memo[n][sum][unused];
	ans = 0;
	for (i = 0; i < 10; i ++){
		use = 1<<i;
