int sum(char li[10], int init, int i, int delta) {
	int n, s = 0;

	for (n = init; n > 0; n--) {
		while (!li[i]) {
			i += delta;
		}
		s += n * i;
	}
	return s;
}

void solve(char li[10], int n, int s, int total, int *cnt) {
	int i, j, value, minimum, maximum;
	char subli[10];

	for (i = 0; i < 10; i++) {
		if (!li[i])
			continue;

		value = i * n + total;
		if (n - 1) {
			for (j = 0; j < 10; j++) {
				subli[j] = li[j];
			}
			subli[i] = 0;

			minimum = value + sum(subli, n - 1, 0, 1);
			maximum = value + sum(subli, n - 1, 9, -1);

			if (minimum <= s && s <= maximum) {
				solve(subli, n - 1, s, value, cnt);
			}
		}
		else if(value == s) {
			*cnt += 1;
			break;
		}
	}
}

