int dp[11][10];
int ans;

int dfs(int n, int s, int depth)
{
	int i, j;

	if (depth == n){
		if (s == 0){
			ans += 1;
		}
		return (ans);
	}

	else {
		for (i = 0; i < 10; i++){
			if (dp[depth][i] == -1){
				for (j = 0; j < 11; j++){
					dp[j][i] = 1;
				}
				dfs(n, s - (depth + 1) * i, depth + 1);
				for (j = 0; j < 11; j++){
					dp[j][i] = -1;
				}
			}
		}
	}
	return (ans);
}

