int count(int n, int s, int U){
	int i, c, b;
	if(C[n][s][U] >= 0)
		return C[n][s][U];
	if(n == 0) {
		if (s == 0)
			c = 1;
		else
			c = 0;
	} else {
		c = 0;
		for(i = 0; i <= 9; i ++){
			b = 1<<i;
			if(!(U & b) && n*i <= s){
				c += count(n-1, s-n*i, U|b);
			}
		}
	}
	return C[n][s][U] = c;
}
