int DP[11][1024][286];

int search(int n,int limit,int bits,int sum){
  int i,res = 0;
  if(sum < 0 || n > 10 || sum > 286){return 0;}

  if(DP[n][bits][sum] != 0){
    return DP[n][bits][sum];
  }


  if(n == limit){
    if(sum / n < 10 && sum%n == 0 && (bits & (1 << sum%n)) == 0){
      res = 1;
    }
  }else{
    for(i = 0; i < 10; i++){
      if((bits & (1U << i)) == 0){
	res += search(n+1,limit,bits | (1U << i),sum - i*n);
      }
    }
  }

  DP[n][bits][sum] = res;
  return res;
}

