int used[10];

int check_sum(int n, int s) {
  int i, count, ni;

  if (n == 0) return (s == 0) ? 1 : 0;

  count = 0;

  for(i = 0; i <= 9; i++) {
    ni = n * i;
    if (! used[i] && s >= ni) {
      used[i] = 1;
      count += check_sum(n - 1, s - ni);
      used[i] = 0;
    }
  }

  return count;
}

