#define SMAX 330 //=0*1+1*2+2*3+...+9*10
int memo[SMAX+1][1<<10];
int count(int n, int sum, int unused)
{
	int i, ans, use;
	if (memo[sum][unused] >= 0)
		return memo[sum][unused];
	ans = 0;
	for (i = 0; i < 10; i ++){
		use = 1<<i;
		if ((unused & use) && n*i <= sum){
			if (n == 1)
				ans += (sum == n*i);
			else
				ans += count(n-1, sum-n*i, unused-use);
		}
	}
	return memo[sum][unused] = ans;
}
