int ladder(int n, int s, int* resource, int res_num)
{
	int i, j;

//	printf("----%d, %d\n", n, s);

	switch(n)
	{
	case 0:
		//本来ここには来ない
		return 0;
	case 1:
		for(i = 0; i < res_num; i++)
		{
			if(resource[i] == s)
			{
				return 1;
			}
		}
		return 0;
	default:
		{
			int ans = 0;
			int resource_tmp[SIZE];
			int index = 0;

			for(i = 0; i < res_num; i++)
			{
				if((resource[i] <= s) && ( resource[i] >= 0))
				{
					index = 0;
					for(j = 0; j < res_num; j++)
					{
						if((j != i) && (resource[j] >= 0))
						{
							resource_tmp[index++] = resource[j];
						}
					}
					ans += ladder(n-1, s-resource[i], resource_tmp, index);
				}
			}

			return ans;
		}
	}
}

