public class Main {

	Scanner sc = new Scanner(System.in);



	int bitC(int a) {

		if (a == 0)

			return 0;

		return bitC(a >> 1) + (a & 1);

	}



	void run() {

		int size = 0;

		for (int i = 0; i < 10; i++)

			size += i * (i + 1);

		int[][] dp = new int[size + 1][1 << 10];

		int[][] map = new int[size + 1][11];

		dp[0][0] = 1;

		for (int z = 0; z < 10; z++) {

			for (int j = 0; j < 1 << 10; j++) {

				if (bitC(j) != z)

					continue;

				for (int k = 1, p = 0; k < 1 << 10; k = k << 1, p++) {

					if ((j & k) != 0)

						continue;

					int bc = bitC(j | k);

					for (int i = 0; i + bc * p < size + 1; i++) {

						dp[i + bc * p][j | k] += dp[i][j];

					}

				}

			}

		}

		for (int j = 0; j < size + 1; j++) {

			for (int i = 0; i < 1 << 10; i++) {

				map[j][bitC(i)] += dp[j][i];

			}

		}

		map[900][900]++;

		for (; sc.hasNextInt();) {

			int n = sc.nextInt();

			int s = sc.nextInt();

			if (n > 10 || s > size) {

				System.out.println("0");

				continue;

			}

			System.out.println(map[s][n]);

		}

	}



	public static void main(String[] args) {

		Main m = new Main();

		m.run();

	}

}

