			int[] a  =new int[n];
			Arrays.fill(a, -1);
			dfs(0, a);
			System.out.println(count);
		}
	}
	static void dfs(int depth, int[] a){
		if(depth == n){
			if(is(a)){
				count++;
			}
			return;
		}
		for(int i = 0; i < 10;i++){
			if(already[i]){
				continue;
			}
			already[i]=true;
			int tmp = a[depth];
			a[depth] = i;

			dfs(depth+1, a);
			a[depth] = tmp;
			already[i]=false;
		}
	}
	static boolean is(int[] a){
		int sum=0;
		for(int i = 0; i < a.length;i++){
			if(a[i]>=0){
			sum += a[i]*(i+1);
			}
		}
		return sum==s;
	}
}

