			P p = new P();
			p.useNum = number.clone();
			p.count = 1;
			p.sum = p.useNum[i] * N;
			p.useNum[i] = -1;

			if (p.sum <= ans)
				que.offer(p);
		}

		int answerCount = 0;
		while (!que.isEmpty()) {

			P pf = que.poll();
			if (pf.count == N && pf.sum == ans) {
				answerCount++;
			}
			for (int i = 0; i < number.length ; i++) {
				if (pf.useNum[i] != -1) {
					P pa = new P();
					pa.useNum = pf.useNum.clone();
					pa.count = pf.count + 1;
					pa.sum = pf.sum + (pf.useNum[i] * (N - pa.count + 1));
					pa.useNum[i] = -1;
					if (pa.count <= N && pa.sum <= ans) {
						que.offer(pa);
					} else {
						break;
					}
				}
			}
		}
		return answerCount;
	}

