	static void solve(int n, int i, int m, int s) {
		if (i == 0) {
			counts[m][s]++;
			return;
		}
		for (int j = 0; j < 10; j++) {
			if ((n & 1 << j) == 0) {
				solve(n | 1 << j, i - 1, m, s + i * j);
			}
		}
	}
}

