					long[] c = cut(remain[i-1][j], k);
					tree[i][l] = tree[i-1][j]*10 + c[0];
					remain[i][l] = c[1];
					l++;
				}
				j++;
			}
			tree[i][l] = -1;
		}

		while (sc.hasNextInt()) {
			int N = sc.nextInt(),
				S = sc.nextInt();

			i = 0;
			int count = 0;
			while (tree[N-1][i] >= 0) {
				int s = 0;
				for (int n = 0 ; n < N ; n++) {
					s += (n+1) * (cut(tree[N-1][i], N-n-1))[0];
				}
				if (s == S) {
					count++;
				}
				i++;
			}
			System.out.println(count+"\n");
		}
	}
}

