public class Main {
	public static void main(String args[]) {
		Scanner sc = new Scanner(System.in);
		int n, s;
		int a[];
		int dp[][][];

		a = new int[10];
		System.gc();
		while (sc.hasNext()) {
			n = sc.nextInt();
			s = sc.nextInt();
			dp = new int[s + 1][1025][12];
			for (int i = 0; i < s + 1; i++) {
				for (int j = 0; j < 1025; j++) {
					for (int k = 0; k < 12; k++) {
						dp[i][j][k] = -1;
					}
				}
			}
			System.out.println(countFuctrialMemo(dp, n, s, a, 1));
			System.gc();
		}
	}

	public static int countFuctrialMemo(int dp[][][], int n, int s, int a[], int k) {
		int binSum = 0;
		int bin = 1;
		for (int i = 0; i < 10; i++) {
			binSum += a[i] * bin;
			bin *= 2;
		}

		if (dp[s][binSum][k] != -1) {
			return dp[s][binSum][k];
		} else if (k == n + 1) {
			if (s == 0) {
				dp[s][binSum][k] = 1;
			} else {
				dp[s][binSum][k] = 0;
			}
			return dp[s][binSum][k];
		} else {
			int count = 0;
			for (int i = 0; i < 10; i++) {
				if (0 <= s - k * i) {
					if (a[i] == 0) {
						a[i] = 1;
						count += countFuctrialMemo(dp, n, s - k * i, a, k + 1);
						a[i] = 0;
					}
				} else {
					break;
				}
			}
			dp[s][binSum][k] = count;
			return dp[s][binSum][k];
		}
	}
}

import java.util.*;
import java.io.*;
import static java.lang.Math.*;

class Main {

    public static void main( final String[] args ) {

	final Scanner stdin = new Scanner( System.in );

	while ( stdin.hasNextInt() ) {

	    final int n = stdin.nextInt();
	    final int s = stdin.nextInt();
	    final boolean[] visited = new boolean[ 10 ];

	    final int ans = dfs( n, s, visited, 0, 0 );
	    System.out.println( ans );
	}
    }

    static int dfs( final int n, final int s, final boolean[] visited, final int sum, final int depth ) {

	if ( sum == s && depth == n ) {
	    return 1;
	} else if ( sum > s || depth > n ) {
	    return 0;
	}
	int limSum = sum;
	int limNum = 9;
	for ( int i = 0; i < n - depth; i++ ) {
	    while ( limNum > 0 && visited[ limNum ] ) {
		limNum--;
	    }
	    limSum += limNum * ( n - i );
	}
	if ( limSum < s ) {
	    return 0;
	}

	int comb = 0;
	for ( int i = 0; i <= 9; i++ ) {
	    if ( !visited[i] ) {
		visited[i] = true;
		comb += dfs( n, s, visited, sum + ( depth + 1 ) * i, depth + 1 );
		visited[i] = false;
	    }
	}
	return comb;
    }    
}

