			count = count(n, s, new boolean[10], 0);
			System.out.println(count);
		}
	}

	static int count(int n, int s, boolean[] cantUse, int count) {
		if (n == 1) {
			if (s < 10 && !cantUse[s]) {
				return count + 1;
			} else return count;
		}
		for (int i = cantUse.length - 1; i >= 0; i--) {
			int s2 = s - i * n;
			if (!cantUse[i] && s2 >= 0) {
				cantUse[i] = true;
				count = count(n - 1, s2, cantUse, count);
				cantUse[i] = false;
			}
		}
		return count;
	}
}

