			for (int i = 0; i < flag.length; i++) {
				flag[i] = false;
			}

			System.out.println(dfs(n, 0));
		}
	}

	private int dfs(int n, int sum) {
		if ((s - sum) > (n * (n + 1) * (2 * n + 1) / 6)) return 0;
		if (n == 0) {
			if (sum == s) return 1;
			return 0;
		}

		int ans = 0;
		for (int i = 0; i < flag.length; i++) {
			int num = flag.length - i - 1;
			if (flag[num] == false) {
				flag[num] = true;
				int result = dfs((n - 1), sum + n * num);
				ans = ans + result;
				flag[num] = false;
			}
		}

		return ans;
	}
