			return;
		}
		for (int i = 0; i < 10; i++) {
			if (use[i]) {
				continue;
			}
			p[n] = i;
			use[i] = true;
			makeParm(sum + ((n + 1) * p[n]), n + 1, p, use);
			use[i] = false;
		}
	}

