					if (a[i] == 0) {
						a[i] = 1;
						count += countFuctrial(n, s - k * i, a, k + 1);
						a[i] = 0;
					}
				} else {
					break;
				}
			}
			return count;
		}
	}

	public static short countFuctrialMemo(short dp[][][], int n, int s, int a[], int k) {
		int binSum = 0;
		int bin = 1;
		for (int i = 0; i < 10; i++) {
			binSum += a[i] * bin;
			bin *= 2;
		}

		if (dp[s][binSum][k] != -1) {
			return dp[s][binSum][k];
		} else if (k == n + 1) {
			if (s == 0) {
				dp[s][binSum][k] = -32767;
			} else {
				dp[s][binSum][k] = -32768;
			}
			return dp[s][binSum][k];
		} else {
