class Main {
	class nPrPermutation implements Iterable<int[]> {//memory over flow対策で配列はコピーしない仕様に変更
		private final int size;
		private final int r;

		public nPrPermutation(int size,int r) {
			if (size <= 0|| r<0 || r>size) throw new IllegalArgumentException();
			this.size = size;
			this.r=r;
		}
		public Iterator<int[]> iterator() {
			return new Iter(size,r);
		}
		private class Iter implements Iterator<int[]> {
			private final int[] source;
			private final int[] end;
			private boolean isFirst=true;
			private int size;
			private int r;

			private Iter(int size,int r) {
				source = new int[size];
				end=new int[size];
				this.size=size;
				this.r=r;
				for(int i = 0; i < size; ++i) {
					source[i] = i;
					end[size-i-1]=i;
				}
			}
			public boolean hasNext() {
				if(isFirst && size==1){
					return true;
				}
				for (int i = 0; i < r; i++) {
					if(source[i]!=end[i]){
						return true;
					}
				}
				return false;
			}
			public int[] next() {
				if(isFirst){
					isFirst=false;
					return source;
				}
				int n = source.length;
				int prev=source[r-1];
				loop:while(true){//stack over flow 対策
