						if (source[i - 1] < source[i]) {
							int j = n;
							while (source[i - 1] >= source[--j]);
							swap(source, i - 1, j);
							reverse(source, i, n);
							if(source[r-1]!=prev)return source;
							else continue loop;
						}
					}
					break loop;
				}
				reverse(source, 0, n);
				return source;
			}
