        {
            StringBuilder sb = new StringBuilder();

            int[,,] dp = new int[11, 331, 1 << 10];

            MakeDP(dp);

            string input;

            while (!string.IsNullOrEmpty(input = Console.ReadLine()))
            {
                string[] temp = input.Split(' ');
