                for (int i = 0; i < 1 << 10; i++)
                {
                    sum += dp[n, s, i];
                }
                sb.AppendLine(sum.ToString());
            }
            Console.Write(sb);
        }

        static void MakeDP(int[,,] dp)
        {
            dp[0, 0, 0] = 1;

            for (int i = 0; i < 10; i++)
            {
                for (int j = 0; j < 331; j++)
                {
                    for (int k = 0; k < 1 << 10; k++)
                    {
                        if (dp[i, j, k] == 0) continue;

                        for (int l = 0; l < 10; l++)
                        {
                            if ((~k & (1 << l)) == 0) continue;

                            dp[i + 1, j + (i + 1) * l, k | (1 << l)] += dp[i, j, k];
                        }
                    }
                }
            }
        }
    }
