		{
			string inputStr;

			int[] numArray = Enumerable.Range (1, 9).ToArray ();
			int limit = numArray.Aggregate (0, ( sum, num ) => sum + num * num);

			while ((inputStr = Console.ReadLine ()) != null)
			{
				int[] inputNum = inputStr.Split (' ').Select (int.Parse).ToArray ();

				bool[] boolArray = new bool[10];

				int count = 0;

				if (inputNum[1] <= limit)
				{
					count = Combination.CombinationCount (inputNum[0], inputNum[1]);
				}

				Console.WriteLine (count);
			}
		}

		static class Combination
		{
			private static int Count { set; get; }

			private const int End = 0;
			private const int Over = -1;

			public static int CombinationCount ( int leftCount, int sum )
			{
				Count = 0;
				bool[] boolArray = new bool[10];
				CombinationCount (leftCount, 1, sum, boolArray);
				return Count;
			}

			private static int CombinationCount ( int leftCount, int multiple, int sum, bool[] useNumArray )
			{
				if (leftCount < 0)
				{
					return End;
				}
				else if (sum < 0)
				{
					return Over;
				}
				if (leftCount == 0 && sum == 0)
				{
					Count++;
					return End;
				}

				for (int lp = 0; lp <= 9; lp++)
				{
					if (!useNumArray[lp])
					{
						bool[] copy = new bool[10];
						useNumArray.CopyTo (copy, 0);
						copy[lp] = true;

						int result = CombinationCount (leftCount - 1, multiple + 1, sum - lp * multiple, copy);

						if (result == Over)
						{
							break;
						}
					}
				}

				return End;
			}

		}
	}
