namespace ConsoleApplication1
{
    class SearchCombination
    {
        int[,] table;
        int[] memo;

        public SearchCombination()
        {
            table = new int[11, 331];
            memo = new int[10];

            DFS(0, 0);
        }

        public int Count(int n, int s)
        {
            if (n > 10 || s > 330) return 0;

            return table[n, s];
        }

        private void DFS(int depth, int sum)
        {
            table[depth, sum]++;

            for (int i = 0; i < 10; i++)
            {
                if (memo[i] == 0)
                {
                    memo[i] = 1;

                    DFS(depth + 1, sum + i * (depth + 1));

                    memo[i] = 0;
                }
            }
        }
    }

    class Program
    {
        static void Main(string[] args)
        {
            StringBuilder sb = new StringBuilder();
            SearchCombination SC = new SearchCombination();

            string input;

            while (!string.IsNullOrEmpty(input = Console.ReadLine()))
            {
                string[] temp = input.Split(' ');
                int n = int.Parse(temp[0]);
                int s = int.Parse(temp[1]);

                sb.AppendLine(SC.Count(n, s).ToString());
            }
            Console.Write(sb);
        }
    }
}

