class Pg
{
    static IEnumerable<List<int>> Read()
    {
        string n;
        while (!string.IsNullOrEmpty(n = Console.ReadLine()))
            yield return n.Split().Select(int.Parse).ToList();
    }
    public static void Main()
    {
        int[,] dp;
        Calq(0, 0, dp = new int[15, 350], new bool[10]);
        Read().ToList().ForEach(x => Console.WriteLine(x[1] > 330 ? 0 : dp[x[0], x[1]]));
    }
    private static void Calq(int cnt, int sum, int[,] dp, bool[] used)
    {
        if (cnt == 11)
            return;
        for (int i = 0; i < 10; ++i)
        {
            if (used[i])
                continue;
            used[i] = true;
            dp[cnt + 1, sum + i * (cnt + 1)]++;
            Calq((cnt+1), sum + i * (cnt+1), dp, used);
            used[i] = false;
        }
    }
}

