namespace AOJ
{
	class Program
	{
		static void Main(string[] args)
		{
			var s = "";
			while ((s = Console.ReadLine()) != null)
			{
				var ns = s.Split(' ').Select(i => int.Parse(i)).ToArray();
				int count = 0;

				foreach (var k in Combination(Enumerable.Range(0, 10), ns[0]))
				{
					if (k.Sum() == ns[1])
					{
						count++;
					}
				}

				Console.WriteLine(count);
			}
		}

		public static IEnumerable<T[]> Combination<T>(IEnumerable<T> source, int length)
		{
			if (length == 1)
			{
				foreach (var n in source)
					yield return new T[] { n };
			}
			foreach (var item in source)
			{
				var list = source.SkipWhile(e => !e.Equals(item)).ToList();
				list.Remove(item);

				foreach (var elem in Combination(list, length - 1))
				{
					yield return (new T[] { item }).Concat(elem).ToArray();
				}
			}
		}
	}
}

