def checkUnique(p, target)
  return false  if p & target == target
  return true
end

def solve(n)
  (0..9).each{|i|
    #1つ少ない個数で求まる和の並び取得
    #それぞれの和の並びをもとに値を１つ追加してテーブルを更新
    @dp[n - 1].each{|k, v|
      v.each{|p|
        next if !checkUnique(p, 2 ** i)
        sum = k + n * i
        perm = p | 2 ** i
        h = @dp[n]
        #すでに同じ和のハッシュが存在する
        if h.key?(sum) then
          # bottle neck
          h[sum] << perm
        #同じ和のハッシュが存在しない
        else
          h.store(sum, [perm])
        end  
      }
    }
  }
end

