def memoize(f):
    memo = {}

    def main(*args):
        if args in memo:
            return memo[args]
        result = memo[args] = f(*args)
        return result

    return main


@memoize
def get_num(remains):
    result = set()
    i = 0
    while remains:
        if remains & 1:
            result.add(i)
        i += 1
        remains >>= 1
    return result


@memoize
def calc(n, s, remains):
    if not n:
        if s:
            return 0
        else:
            return 1
    if s <= 0:
        return 0

    rs = get_num(remains)

    return sum(calc(n - 1, s - n * m, remains ^ (1 << m)) for m in rs)


