fn comb(v: &mut Vec<Vec<u32>>, usd: &mut Vec<bool>, i: usize, sm: usize) {
  if i < 11 {
    for k in 0 .. 10 {
      if !usd[k] {
        usd[k] = true;
        let nsm = sm + i * k;
        v[i][nsm] += 1;
